import React, { useState } from 'react';
// import AddProduct from '../product/AddProduct'
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText
  } from 'reactstrap';

 export default (props) => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
      <div>
        <Navbar color="primary" primary expand="md">
          <NavbarBrand href="/">Atualizar pre√ßo de produtos</NavbarBrand>
          <NavbarToggler onClick={toggle} />
          <Collapse isOpen={isOpen} navbar>
            <Nav className="mr-auto" navbar>
              <NavItem>
                <NavLink href="/components/">Lista de produtos</NavLink>
              </NavItem>

              <NavItem>
                <NavLink to="../product/AddProduct.jsx">Cadastrar produto</NavLink>
              </NavItem>


            </Nav>
            <NavbarText>Lucas Souza</NavbarText>
          </Collapse>
        </Navbar>
      </div>
    );
  }
